import { NavLink } from 'react-router-dom'
const Hamburgernavbar = ({ user, onLogout ,onclose }) => {
const Hamburgernavbar = () => {
  return (
    <div className='fixed right-0 top-0 w-64 h-full bg-white z-[9999] text-black font-normal rounded-md 
       shadow-sm transform transition-transform duration-300 ease-in-out  '>
        <ul className=' sm:flex-col gap-5 text-sm text-gray-700'>
       <NavLink to="/" onClick={onclose} className='flex flex-col items-center  hover:text-indigo-600 gap-1'><li>Home</li></NavLink>
       <NavLink to="/Collections"onClick={onclose} className='flex flex-col hover:text-indigo-600 items-center gap-1'><li>Collections</li></NavLink>
       <NavLink to="/About"onClick={onclose} className='flex flex-col hover:text-indigo-600 items-center gap-1'><li>About</li></NavLink> 
       <NavLink to="/Contact"onClick={onclose} className='flex flex-col hover:text-indigo-600 items-center gap-1'><li>Contact</li></NavLink> 
       </ul>
    </div>
  )
}
}
export default Hamburgernavbar
